import { BottomTabScreenProps } from "@react-navigation/bottom-tabs";
import {
  CompositeScreenProps,
  NavigatorScreenParams,
} from "@react-navigation/native";
import { NativeStackScreenProps } from "@react-navigation/native-stack";

declare global {
  namespace ReactNavigation {
    interface RootParamList extends RootTabParamList {}
  }
}

// Root tab screen
export type RootTabParamList = {
  Home: NavigatorScreenParams<MainStackParamList> | undefined;
  Explore: NavigatorScreenParams<MainStackParamList> | undefined;
  Profile: undefined;
};

export type RootTabScreenProps<Screen extends keyof RootTabParamList> =
  CompositeScreenProps<
    BottomTabScreenProps<RootTabParamList, Screen>,
    CompositeScreenProps<
      NativeStackScreenProps<MainStackParamList>,
      NativeStackScreenProps<MainStackParamList>
    >
  >;

export type MainStackParamList = {
  Main: undefined;
  Location: { locationID: string };
  Restaurant: { locationID: string; restaurantID: string };
  Accessibility: { 
    elevators: ElevatorType[],
    parkings: ParkingType[], 
    toilets: ToiletType[], 
    ramps: RampType[], 
    doors: DoorType[]
  };
  Modal: undefined;
};

export type MainStackScreenProps<Screen extends keyof MainStackParamList> =
  NativeStackScreenProps<MainStackParamList, Screen>;

export interface LocationType {
  locationID: string;
  locationtionName: string;
  placeImage: string;
  ramp: boolean;
  toilet: boolean;
  elevator: boolean;
  door: boolean;
  parking: boolean;
  distance: number;
}

export interface LocationInfoType {
  category: string;
  comments: CommentType[];
  distance: number | null;
  doors: DoorType[];
  elevators: ElevatorType[];
  images: string[];
  lat: number;
  lng: number;
  located: string;
  locationId: string;
  locationName: string;
  openTime: OpenResponseType[];
  parkings: ParkingType[];
  ramps: RampType[];
  rating: number;
  restaurants: RestaurantSummaryType[];
  toilets: ToiletType[];
}

export interface CommentType {
  userId: number;
  userName: string;
  profileImageURL: string;
  rating: number;
  message: string;
  timestamp: Date;
}

export interface Accessibility {
  id: number;
  located: string;
  remark: string;
}

export interface DoorType extends Accessibility {
  doorType: string;
  floor: string;
  passable: boolean;
}

export interface ElevatorType extends Accessibility {
  passable: boolean;
  switch: boolean;
}

export interface OpenResponseType {
  day: string;
  time: string;
}

export interface ParkingType extends Accessibility{
  enoughSpace: boolean;
  nearEntry: boolean;
  floor: string;
}

export interface RampType extends Accessibility{
  slope: string; 
  level: number;
  handrail: boolean;
  floor: string;
}

export interface ToiletType extends Accessibility{
  type: string;
  doorType: string;
  handrail: boolean;
  floor: string;
}

export interface RestaurantSummaryType {
  logoURL: string;
  name: string;
  restaurantId: string;
}

export interface RestaurantType extends LocationType {
  restaurantID: string;
  restaurantName: string;
}

export interface GoogleUserResponse {
  id: string;
  email: string;
  verified_email: boolean;
  name: string;
  given_name: string;
  family_name: string;
  picture: string;
  locale: string;
}

export interface FacebookUserResponse {
  name: string;
  picture: {
    data: {
      height: number;
      is_silhouette: boolean;
      url: string;
      width: number;
    };
  };
  id: string;
}

export interface UserDataType {
  token?: string;
  data?: {
    id: string;
    name: string;
    picture: string;
  };
  loginOption?: "facebook" | "google";
}

export interface LatLngType {
  latitude?: number;
  longitude?: number;
}
